import React from 'react';

const AddUser = props => {

    const addUserHandler = (event) =>{
        event.preventDefault();
    }

    return (
    <Card>
        <form onSubmit={addUserHandler}>
            <label htmlFor="user">User</label>
            <input id="user" type="text"></input>
            <button>Add User</button>
        </form>
    </Card>
    )
}

export default AddUser ;
